import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import profilestyle from "../assets/profile.module.css";
import Footers from "../Component/footer";
import Navbar from "../Component/navbar";
import axios from "axios";

const Profile = () => {
  const [recipe, setRecipe] = useState([]);
  const [loading, setLoading] = useState(true);
  const [iserror, setIserror] = useState(false);

  useEffect(() => {
    axios
      .get("http://localhost:4000/recipe/list")
      .then((res) => {
        setTimeout(() => {
          setRecipe(res.data);
          setLoading(false);
        }, 100);
        console.log(res);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  handleRemove = movie => {
    const url = `http://localhost:3000/movies/${movie.id_recipe}`;

    axios
      .delete(url)
      .then(res => {
        this.setState(previousState => {
          return {
            recipe: previousState.recipe.filter(r => r.id_recipe !== recipe.id_recipe)
          };
        });
      })
      .catch(err => {
        console.log(err);
      });
    };

  return (
    <div className={profilestyle.customBody}>
      <header className={profilestyle.customHeader}>
        <nav className="navbar navbar-expand-lg bg-transparent fixed-top p-4">
          <div className="container">
            <button
              className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarNav"
              aria-controls="navbarNav"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNav">
              <ul className="navbar-nav">
                <li className="nav-item px-3">
                  <Link
                    className={`nav-link active ${profilestyle.customNav}`}
                    aria-current="page"
                    to="/landing"
                  >
                    Home
                  </Link>
                </li>
                <li className="nav-item px-3">
                  <Link
                    className={`nav-link active ${profilestyle.customNav}`}
                    to="/add"
                  >
                    Add Recipe
                  </Link>
                </li>
                <li className="nav-item px-3">
                  <Link
                    className={`nav-link active ${profilestyle.activeCustom} ${profilestyle.customNav}`}
                    to=""
                  >
                    Profile
                  </Link>
                </li>
              </ul>
            </div>
          </div>
        </nav>
      </header>
      <main className={profilestyle.customMain}>
        <section className="my-5">
          <div className="container">
            <div className={`text-center ${profilestyle.customSpace}`}>
              <img
                src={require("../assets/image/Ellipse 127.png")}
                alt="photo profile"
              />
              <button type="button" className={`btn ${profilestyle.btnCustom}`}>
                <a href="#updateProfile" data-bs-toggle="collapse">
                  <img
                    src={require("../assets/image/Vector.png")}
                    className={profilestyle.customAwesome}
                  />
                </a>
              </button>
              <p className={profilestyle.customNameProfile}>Ranti Maria</p>
              <div
                className={`collapse multi-collapse ${profilestyle.customSpaceUpdate}`}
                id="updateProfile"
              >
                <div className={`text-center ${profilestyle.customSpace}`}>
                  <div className="d-flex flex-column">
                    <div>
                      <button
                        type="button"
                        className={`btn ${profilestyle.btnCustomUpdate} my-1`}
                      >
                        Change Photo Profile
                      </button>
                    </div>
                    <div>
                      <button
                        type="button"
                        className={`btn ${profilestyle.btnCustomUpdate} my-1`}
                      >
                        <Link className={profilestyle.aBtn} to="/change">
                          Change Password
                        </Link>
                      </button>
                    </div>
                  </div>
                </div>
              </div>
            </div>
            <p>
              <Link
                className="btn mx-4"
                data-bs-toggle="collapse"
                to="#multiCollapseExample1"
              >
                My Recipe
              </Link>
              <Link
                className="btn mx-4"
                data-bs-toggle="collapse"
                to="#multiCollapseExample2"
              >
                Saved Recipe
              </Link>
              <Link
                className="btn mx-4"
                data-bs-toggle="collapse"
                to="#multiCollapseExample3"
              >
                Liked Recipe
              </Link>
            </p>

            <div className="collapse multi-collapse" id="multiCollapseExample1">
              <div className="container">
                <div
                  className={`${profilestyle.grid12} ${profilestyle.gapMedium}`}
                >
                  {loading ? (
                    <p>Loading...</p>
                  ) : iserror ? (
                    <p>failed to get</p>
                  ) : (
                    recipe.map((data, i) => {
                      // {
                      //     "id_recipe": 14,
                      //     "title": "Nikmat",
                      //     "image": "1663827497930.jpg",
                      //     "ingredient": "masukkan bumbu, siapkan air panas , dan masak",
                      //     "videostep": "dsdsdsd",
                      //     "createdat": "2022-09-08T17:00:00.000Z"
                      // },
                      return (
                        <>
                          <div
                            key={data.id_recipe}
                            className={`${profilestyle.cusGridMd3} position-relative p-0`}
                          >
                            <div>
                              <button
                                type="button"
                                className="btn btn-danger my-1"
                              >
                                Delete
                              </button>
                            </div>
                            <img
                              src={require("../assets/image/makanan1.png")}
                              className="img-fluid"
                              alt={data.title}
                            />
                            <span
                              className={`position-absolute ${profilestyle.titleImage}`}
                            >
                              {data.title}
                            </span>
                          </div>
                          <div className="d-flex flex-column"></div>
                        </>
                      );
                    })
                  )}

                  {/* <div
                    className={`${profilestyle.cusGridMd3} position-relative p-0`}
                  >
                    <img
